import 'bootstrap/dist/css/bootstrap.min.css'
import { Button } from 'reactstrap'

interface ModalProps{
    children: React.ReactNode
    title: number
}

//create modals
export function Modal({ children}: ModalProps) {
    return (
        <div className='Modal'>
            <div className="text-dark modals">
                <Button></Button>
                {children}
            </div>
        </div>
    )
}
